import React from "react";
import {
  MessageContainer,
  MessageWrapper,
  MessageRow,
  Avatar,
  Title,
  Body,
  Cred,
  Del,
} from "./MsElements";

import img from "../../../../images/svg-11.svg";
import { AiFillDelete } from "react-icons/ai";
import { GrCheckbox } from "react-icons/gr";

const Messages = () => {
  return (
    <div
      style={{
        display: "flex",
        "flex-direction": "row",
        "align-items": "center",
        "margin-bottom": "20px",
      }}
    >
      <MessageContainer>
        <MessageWrapper>
          <div
            style={{
              display: "flex",
              "flex-direction": "row",
              "align-items": "center",
              "margin-bottom": "20px",
            }}
          >
            {" "}
            <Avatar src={img} alt="profilPic"></Avatar>
            <Title>TechPunch Admin</Title>
          </div>
          <MessageRow>
            <GrCheckbox size="20px"></GrCheckbox>
            <Body>
              Lorem ipsum, dolor sit amet consectetur adipisicing elit. Fugit
              eaque vel deleniti laborum eius rem rerum laboriosam excepturi,
              delectus earum numquam! Labore quos amet illum consectetur, atque
              praesentium mollitia quia!
            </Body>
            <Del>
              <AiFillDelete color="white" size="20px"></AiFillDelete>
            </Del>
          </MessageRow>
          <Cred>18-07-2021</Cred>
        </MessageWrapper>
      </MessageContainer>
    </div>
  );
};

export default Messages;
